import React from 'react';
import './styles.css';
import Header from './components/header';
import Routes from '../src/routes/routes';
import UserContextProvider from '../src/contexts/UserContext';


const App = () => {

  return(
    <UserContextProvider>
      <div className="App">
        <Header />
        <Routes />
      </div>
    </UserContextProvider>
  );
}

export default App;
